import React from 'react';

class Navbar extends React.Component {
    render() {
        return (
            <div className="navbar">
                <img className="logo" src="https://files.slack.com/files-pri/T5S0K050F-FH4JM97FY/mytinerarylogo.png" alt="Page Logo" />
            </div>
        );
    }
}

class Header extends React.Component {
    render() {
        return (
            <div className="header">
                <h1> <code>{this.pageTitle}</code> </h1>
                <ul>
                    <li>Home</li>
                    <li>Members</li>
                    <li style="float:right;">Login / Register</li>
                </ul>
            </div>
        );
    }
}

export default Navbar;
